const NavLink = (props) => {
    return (
        <li>
            <a className="nav-link text-uppercase">{props.title}</a>
        </li>
    )
}


const NavMenu = () => (
    <nav className="chi-nav navbar fixed-top">
        <a className="navbar-brand text-uppercase">Next</a>
    </nav>
)

export default NavMenu
